Tora Tora Tora

War Documentary hosted by Trevor Nichols, published by History Channel in 2000 - English narration


Information
------------------------------

December 7 1941 was a turning point in history. The world was forever changed after the fateful attack on Pearl Harbour. It was the most daring naval and army manoeuvres of all time. In less than two hours without warning a swarm of Japanese fighter planes, each bearing a red sun soared over pearl harbour, Hawaii. At 7.53am a Japanese commander radioed to his pilots, &quot;Tora, Tora, Tora!&quot; In a matter of minutes, bombs and torpedoes fell from the sky paralysing U.S pacific naval forces. The day of infamy began with an intricate well-planned attack and a thunderous roar. The shock and anger over the surprise raid rallied a divided nation together more than any other event known to modern man.

Produced by Greystone Communications.

